    false,nt"url": null,nt"notes": "This digital data set defines the model
    grid and infiltration values simulated in the transient ground-water flow model
    of the Death Valley regional ground-water flow system (DVRFS), an approximately
    45,000 square-kilometer region of southern Nevada and California. The DVRFS model
    grid is north-south-oriented, consists of 194 rows and 160 columns, and has a constant
    grid-cell spacing of 1,500 meters. Model cells are attributed with infiltration
    rates that are used as a component of recharge in the flow model. The DVRFS transient
    ground-water flow model is one of the most recent in a number of regional-scale
    models developed by the U.S. Geological Survey (USGS) for the U.S. Department of
    Energy (DOE) to support investigations at the Nevada Test Site (NTS) and at Yucca
    Mountain, Nevada (see "Larger Work Citation", Chapter A, page 8).",nt"license_title":
